insert  into `texttable`(`textid`,`texttitle`,`description`,`moduleid`) values (2,'On-Boarding','WELCOME TO HALCYON MARINE HEALTHCARE SYSMTEMS',2),(3,'','                                   WORK ETIQUETTE\r\n                        WORKPLACE CHARACTERISTIC\r\n\r\n\r\n',4),(4,'Halcyon Marine Healthcare Systems','The Halcyon is a seabird known to those who sail. They lay their eggs on the beach in the middle of winter. When the eggs are hatching the waters are still and the weather is fine.\r\n\r\nTo the seafarers we serve- we wish them halcyon days, an untroubled time of peace and calm, as they journey the high seas.\r\n\r\nSince 2006 Halcyon Marine Healthcare Systems has been committed to ensuring and promoting the health and safety of the seafarer so that they may pursue long, productive and prosperous seafaring careers.\r\n\r\nThrough a fully computerized and modern medical screening process; electronic records and database; health promotion and patient education; coordination and collaboration with government agencies, insurers and shipowners, Halcyon Marine Healthcare Systems has anticipated and responded to the needs, expectations and changes in the maritime industry to remain at the forefront of maritime health care of the highest standard.\r\n\r\n',12),(5,'Welcome Aboard','Welcome to Halcyon Marine Healthcare Systems.\r\n\r\nWelcome aboard! ',12),(6,'','',13),(7,'Unit Manual','Objective\r\n\r\n\r\nThis policy is intended to ensure the safety and security of all employees, the management,\r\npatients, clients, consultants, business partners, guests and patients at all times, while inside the\r\nclinic premises.',13),(8,'Company Orientation','Welcome to Halcyon Marine Healthcare Systems',15),(10,'Life Saving TIps. :D','I know bringing your own lunch to work is very unpopular, either because it takes a lot of time to prepare it or it is embarrassing. I have had my share of taunts when I bring lunch to work. I remember a colleague asking me one time: â€œnagtitipid ka baâ€? (Are you trying to save money?* believe me, it sounds more hurtful in Filipino) when I brought my baon (packed lunch) to work.\r\n\r\nHowever let me tell you that you could drastically cut down on your expenses on food if you bring packed lunch to work. If you work in a call center in Makati, you are most probably spending about seventy pesos per meal. But did you know that you could already make two meals with that same amount of money at home? Donâ€™t you always feel like those food concessionaires are selling you overpriced food?\r\n\r\nOne way to save money if you donâ€™t cook is buying a small can of tuna which costs about twenty pesos and it would be even healthier.\r\n\r\nWhile youâ€™re at it, why donâ€™t you stop buying overpriced snacks from the vendo and convenience store? Donâ€™t you know that you can save money buy buying in bulk from the supermarket? Most of the things that vending machines and convenience stores sell can be bought by bulk from the supermarket at half their prices. The truth is a lot of the food sold in offices located in Makati is just so overpriced that itâ€™s not even funny. You probably think that paying ten pesos for something that you could get at five pesos is no big deal but when you do this every day it will surprise you on how much you could save if you just stop doing it.',17),(12,'JD','Job Title:	2D Echo Technician	\r\n			\r\n\r\n\r\nDivision:	Medical Division	\r\n\r\n\r\nDepartment/ Unit:	Medical Services Department\r\n				ï‚·  Testing Unit	\r\n\r\n\r\nReports to:	Testing Supervisor/	\r\n				Medical Operations Manager\r\n\r\n\r\nSupervises:	None	\r\n\r\n\r\nWorking Days/Hours: Compressed Work Week Schedule\r\n				Mon/Tues/Wed/Friday: 8:00 AM to 6:00PM\r\n				Thursday: 8:00 AM to 5:00 PM',16),(13,'test','est',19),(14,'Company Policy','Company Policy Overiview\r\n\r\nI. Office Attire\r\nII. Identification Cards and Name Plates\r\nIII. Company Uniforms\r\nIV. Corporate Conduct and Behavior\r\nV. Personal Matter\r\nVI. Selling of Merchandise, Business, & Solicitation\r\nVII. Use of telephone and mobile phones\r\nVIII. Misuse of internet and network access\r\nIX. Use of Office Supplies\r\nX. Use of Equipments\r\nXI. Personal Mails\r\nXII. Staff Lokcer\r\nXIII. No Smoking Policy\r\nXIV. Sexual Harassment',22),(15,'Recruitment Process','Welcome to recruitment Process',23),(16,'About Halcyon','The Halcyon is a seabird known to those who sail. They lay their eggs on the beach in the middle of winter. When the eggs are hatching the waters are still and the weather is fine.\r\n\r\nTo the seafarers we serve- we wish them halcyon days, an untroubled time of peace and calm, as they journey the high seas.\r\n\r\nSince 2006 Halcyon Marine Healthcare Systems has been committed to ensuring and promoting the health and safety of the seafarer so that they may pursue long, productive and prosperous seafaring careers.\r\n\r\nThrough a fully computerized and modern medical screening process; electronic records and database; health promotion and patient education; coordination and collaboration with government agencies, insurers and shipowners, Halcyon Marine Healthcare Systems has anticipated and responded to the needs, expectations and changes in the maritime industry to remain at the forefront of maritime health care of the highest standard.',21),(18,'Customer Service','Good customer service is the lifeblood of any business.\r\n\r\n\r\nGood customer service is all about bringing customers back. And about sending them away happy - happy enough to pass positive feedback about your business along to others, who may then try the product or service you offer for themselves and in their turn become repeat customers.\r\n\r\n\r\n\r\nThe essence of good customer service is forming a relationship with customers â€“ a relationship that that individual customer feels that he would like to pursue.\r\n\r\n\r\n\r\n\r\n\r\n',25),(19,'Introduction','This Chapter will focus on testing',28),(20,'Intro 2','Part 2',28),(21,'intro','this module is ',32),(22,'Halcyon isâ€¦',' \r\nThe Halcyon is a seabird known to those who sail. They lay their eggs on the beach in the middle of winter. When the eggs are hatching the waters are still and the weather is fine. To the seafarers we serve- we wish them halcyon days, an untroubled time of peace and calm, as they journey the high seas.\r\n',21),(23,'Halcyon was established ...','Since 2006 Halcyon Marine Healthcare Systems has been committed to ensuring and promoting the health and safety of the seafarer so that they may pursue long, productive and prosperous seafaring careers. ',21),(24,'Through','Through a fully computerized and modern medical screening process; electronic records and database; health promotion and patient education; coordination and collaboration with government agencies, insurers and ship owners, Halcyon Marine Healthcare Systems has anticipated and responded to the needs, expectations and changes in the maritime industry to remain at the forefront of maritime health care of the highest standard.',21),(25,'GHASDASGHDF','Through its Laboratory Research Division (LRD), RITM shares its expertise to other laboratories through various trainings aimed at building laboratory technical capacity in infectious disease microbiology.\r\n\r\nOur regular trainings range from basic workshops on specimen collection to performance of specialized laboratory tests, from biosafety to ethical use of laboratory animals in research. Various platforms are offered, from virus isolation to bacterial detection; from microscopy to serologic and molecular techniques. Participants shall benefit much from experts from the laboratory divisionâ€™s National Reference Laboratories and Core Facilities.\r\n\r\n \r\n\r\nANTI MICROBIAL REFERENCE SURVEILLANCE\r\n\r\nSurveillance of Fastidious Bacterial Pathogens Causing Respiratory and Invasive Infections in the Philippines\r\n\r\nBasic Aerobic bacteriology and Data Management training module (WHONET PROGRAM)\r\n\r\nTraining of Infrequently Isolated Bacteria (i.e. HACEK and other Non â€“ Fermenting Organisms)\r\n\r\nData Management Training Module (WHONET PROGRAM)\r\n\r\n \r\n\r\nMOLECULAR BIOLOGY\r\n\r\nTraining Workshop on Molecular Diagnosis of Infectious Diseases by PCR\r\n\r\n \r\n\r\nMICRBIOLOGY\r\n\r\nGroup Training Course in the Laboratory Diagnosis of Medically Important Bacterial Pathogens\r\n\r\n ',16),(26,'Halcyon Is','The Halcyon is a seabird known to those who sail. They lay their eggs on the beach in the middle of winter. When the eggs are hatching the waters are still and the weather is fine.',33);

